	node_node_linear_1( tu0.tensor_linear, tensor_layers_1_l0_weight, tensor_layers_1_l0_bias, tu1.tensor_linear_1);
	node_node_leaky_relu( tu1.tensor_linear_1, tu2.tensor_leaky_relu);
	node_node_linear_2( tu2.tensor_leaky_relu, tensor_layers_1_l1_weight, tensor_layers_1_l1_bias, tu1.tensor_linear_2);
	node_node_add_12( tu1.tensor_linear_2, tu0.tensor_linear, tu2.tensor_add_12);
	node_node_leaky_relu_1( tu2.tensor_add_12, tu0.tensor_leaky_relu_1);
	node_node_linear_3( tu0.tensor_leaky_relu_1, tensor_layers_2_l0_weight, tensor_layers_2_l0_bias, tu1.tensor_linear_3);
	node_node_leaky_relu_2( tu1.tensor_linear_3, tu2.tensor_leaky_relu_2);
	node_node_linear_4( tu2.tensor_leaky_relu_2, tensor_layers_2_l1_weight, tensor_layers_2_l1_bias, tu1.tensor_linear_4);
	node_node_add_28( tu1.tensor_linear_4, tu0.tensor_leaky_relu_1, tu2.tensor_add_28);
